import React from 'react';
import ReactDOM from 'react-dom';
import "./index.css";


 const App =()=>{
      return(<>
      <div> <form>
      <label>name:-</label>
             <input type="text" /><br/>
             <label>password:-</label>
             <input type="text" /><br/>
             <button  >submit</button>
             </form>
      </div>
      </>)
 }
  
ReactDOM.render(<App/>,
     document.getElementById('root'));
